  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116715 includes chemical,
  physical and time series data collected from MOORINGS in the Coastal Waters of SE
  Alaska from 2011-06-10 to 2012-09-29. These data include AIR-SEA DIFFERENCE - PARTIAL
  PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, CARBON DIOXIDE - AIR, OXYGEN - PERCENT
  SATURATION, Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include Bubble type equilibrator
  for autonomous carbon dioxide (CO2) measurement, Carbon dioxide (CO2) gas analyzer,
  Humidity Sensor, oxygen meter and thermosalinographs.nnThese data were collected
  by Jeremy Mathis of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory,
  Al Devol of University of Washington and Jan Newton, Matthew Alford and John Mickett
  of University of Washington; Applied Physics Laboratory as part of the Mooring_Dabob_122W_478N_Jul2012_Sep2012
  and Mooring_Dabob_122W_478N_Jun2011_Jul2012 data set. CDIAC assigned the following
  cruise ID(s) to this data set: Dabo20110610 and Dabo20120712.nnThe Global CO2 Time-series
  and Moorings Project involves international groups from 18 countries who have mounted
  sensors on moored buoys to provide high resolution time-series measurements of atmospheric
  boundary layer and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series
  and Moorings Project is coordinated by UNESCO International Ocean Carbon Coordination
  Project (IOCCP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
